const Queens = () => {
    const [queens, setQueens] = useState([]);

    useEffect(() => {
        fetch('localhost:3000/api/queens', {
            method: 'GET'
        })
        .then(queenList => {
            console.log(queenList);
            setQueens(queenList);
        })
        .catch(err => console.log(err));
    }, [])

    return (
        <div>

        </div>
    )
}

export default Queens
